import React, { Component } from 'react'
import { Switch, Route, Redirect } from 'react-router-dom';
import TrainsHome from './Home'
import TrainsAddUpdate from './AddUpdate'


export default class Trains extends Component {

    render() {
        return (
            <Switch>
                <Route exact path='/dev/trains' component={TrainsHome} />
                <Route path='/dev/trains/addupdate' component={TrainsAddUpdate} />
                <Redirect to='/dev/trains'/>
            </Switch>
        )
    }
}
